function App() {
  const [show, setShow]=useState(true)
  return (
    <div className="App" >
      <img src="https://i.ibb.co/Yy6Xqtw/1.jpg" alt="CompanyLogo"/>
      {
      show?<PieChart className="chart"/>:null
      }
      <button onClick = {()=>setShow(!show)}>Toggle</button>
    </div>
  );
}

app.listen(process.env.PORT)

